import React from "react";
import "./index.css";
import MainContainer from './components/MainContainer'

export default function App() {
  const userData=[
   { title:"Tuyizere Jean de Dieu",price:19000.0,date: new Date(2022,2,3)},
    { title:"Cyimana Faisal",price:18000.0,date: new Date(2022,3,3)},
    { title:"Uwacu Deny",price:20000.0,date: new Date(2022,4,3)},
    { title:"Ganza Bobu",price:40000.0,date: new Date(2022,5,3)},
  ]
   return (
     <div>
       <h2 className="App"> Welcome to Our Chatting Application</h2>
       <MainContainer items={userData}></MainContainer> 
     </div>
   )
}
